import React from 'react';
import { ThemeProvider } from 'styled-components';
import theme from './theme';  // Make sure this import matches the location of theme.js

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div>
        <h1>Hello, Intellimint!</h1>
      </div>
    </ThemeProvider>
  );
}

export default App;
